import Link from "next/link"
import {Get_db} from "../data/post"
var data=({postData})=>(
    <body>
        <div> Date bese</div>
        <Link href="/">Home page </Link>
        <h1>{postData.title}</h1>
    </body>
)

export async function getProps(){
    const postData=Get_db.getposts()
    return{
        props:{
            postData
        }
    }
}
export default data
